    ["20010130"]={skillId=20010130,skillTitle1="",skillElement1=3,skillText1="[404040]法尼娅进入极奏状态，具现出一柄巨型雷枪，贯穿直线内敌方单位，造成一次雷属性伤害；极奏结束后，法尼娅将进入持续一段时间的[-][6CAE93]满溢状态·雷[-][404040]。[-]\n\n[6CAE93]满溢状态·雷[-]\n[404040]普通攻击将造成雷属性伤害。[-]",skillTitle2="",skillElement2=0,skillText2="",skillStory="[i]传说朝着流星许愿能够实现愿望，倘若这颗流星是法尼娅制作出来的呢？或许朝着法尼娅许愿也可以实现愿望吧，况且这颗流星，还是必中流星。[/i]"},
    ["20020110"]={skillId=20020110,skillTitle1="点按",skillElement1=0,skillText1="[404040]驱动律叶发射一颗无属性能量弹，造成小范围物理伤害。[-]",skillTitle2="长按",skillElement2=0,skillText2="[404040]积蓄一段时间，驱动律叶发射一颗火属性能量弹，造成以小范围火属性伤害。[-]",skillStory=""},
    ["20020120"]={skillId=20020120,skillTitle1="",skillElement1=2,skillText1="[404040]驱动律叶将储存的火元素小道具大量丢出，并追踪附近的敌人，在命中时造成火属性伤害。[-]",skillTitle2="",skillElement2=0,skillText2="",skillStory="[i]从卡娜莉亚那里等价换来的某种小道具，通过凝聚能源附着于道具上制作而成了小型炸弹。从攻击敌人的手段来说，这或许是个不错的法子。当然，因为钱财有限，偶尔会有奇怪的东西混在其中。[/i]"},
    ["20020130"]={skillId=20020130,skillTitle1="",skillElement1=2,skillText1="[404040]奈纳进入极奏状态，将火元素源能力量充入律叶中，连续释放8枚火元素小道具，造成大量范围火属性伤害。[-]",skillTitle2="",skillElement2=0,skillText2="",skillStory="[i]感知链接被用在了奇怪的方向，但效果意外不错，不知道对导师会不会有副作用。这种攻击方式，恐怕会让奈纳损失不少的储备道具，和金钱。[/i]"},
    ["20030110"]={skillId=20030110,skillTitle1="点按",skillElement1=0,skillText1="[404040]驱动律叶发射小激光束，造成物理伤害。[-]",skillTitle2="长按",skillElement2=0,skillText2="[404040]积蓄一段时间，松手后释放出激光束，造成多次物理伤害；光束持续1s。[-]",skillStory=""},
